	<style>

		body {
			margin: 30px;
			position: relative;
		}
		#map {
			font-size: 200px;
			display: inline-block;
			width: 200px;
			height: 200px;
		}
		#map > [class*="map-"] {
			color: black;
			position: absolute;
			top: 0;
			left: 0;
		}

		#map > [data-age] {
			color: grey;
		}
		#map-legend  {
			display: inline-block;
			position: relative;
			width: 100px;
			height: 190px;
			vertical-align: top;
			text-align: center;
		}
		#map-legend .key { 
			background: linear-gradient(to bottom, black 0%, grey 100%);
			display: inline-block;
			margin: 0 auto;
		    height: 80%;
		    width: 25px;
		}

		#map-legend .keyValue { 
			display: inline-block;
			vertical-align: top;
		}

		#map-legend .keyValue div {
			height: 68px;
		} 
		
		h4 {
			margin-top: 0; 
		}

		.legendContainer {
			display: inline-block;
			width: 30%;
			vertical-align: top;
		}

		#mapCounties {
			display: flex;
			justify-content: space-between;
			position: relative;
			max-width: 1024px;
			margin: 0 auto;
			overflow: hidden;
		}

		.mapContainer {
			visibility: hidden;
		}

		.mapContainer.active {
			visibility: visible;
		}

		#georgiaMap {
			display: inline-block;
		}

		#georgiaMap path {
			opacity: 0.5;
		}

		#georgiaMap path.active {
			opacity: 1;
			border: 1px solid;
		}

		#legend {
			display: inline-block;
			vertical-align: top;
		}

		table#legend tr.scale td {
		 height: 1em;
		 width: 11.1111%;
		}
		table#legend tr.text td:first-child {
		 text-align: left;
		}
		table#legend tr.text td:nth-child(2) {
		 text-align: center;
		}
		table#legend tr.text td:last-child {
		 text-align: right;
		}

		@keyframes donut-spin {
		  0% {
		    transform: rotate(0deg);
		  }
		  100% {
		    transform: rotate(360deg);
		  }
		}

		.donutContainer {
			position: absolute;
			width: 100%;
			height: 100%;
			background-color: white;
			text-align: center;
		}	

		.donutContainer.hide {
			display: none;
		}

		.donut {
		  position: absolute;
		  border: 6px solid rgba(0, 0, 0, 0.1);
		  border-left-color: #7983ff;
		  border-radius: 50%;
		  width: 60px;
		  height: 60px;
		  top: 40%;
		  animation: donut-spin 1.2s linear infinite;
		  text-align: center;
		  left: 50%;
		}

		table#details {
			display: none;
		}

		table#details.active {
			display: block;
		}

		#mapContent iframe { 
			visibility: hidden;
		}
		
		#mapContent {
			width: 800px;
			height: 600px;
		}

		.leaflet-container {
		 cursor: default;
		}

		#mapRace {
			width: 800px;
			height: 600px;
		}
	</style>
	<script src="http://cdn.leafletjs.com/leaflet-0.7.2/leaflet.js"></script>
